description:
This is the version updated in August 2013 of the Siemens Taurus ES64U4 in 20 official liveries/repaints: Adria, CFI, FUC, FuoriMuro, InRail, OBB, OBBItalia, SLB 1216, Speedrecord, SZ541, SZ 541 001, WLC 1216 954, Cargo Serv, Leonardo, LTE, OBB 175y, PKP Heineken, RTS, SLB and WLC ROLAND. 9 are Quick Drive compatible.

This package requires the HRQ Siemens Taurus ES64U2 to be installed.



Please support the developers and buy some of their content if you can afford it.


Please use the email address for requests and questions and if you want to share an addon with the community then contact us and we will post it on your behalf. If you would like to contribute, please read the Readme.pdf.


